package week2day1;

public class FibonacciSeries {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int input=8;
		int var=0;
		int var1=1;
		int var2 ;
		
		for (int i = 0; i<input; i++) {
			System.out.println(var);
			var2 =var+var1;
			
			var= var1;
			var1=var2;
			
			
		}
	}

}
